import React, { useContext } from 'react';
import "./App.css";

import {
    BrowserRouter as Router,
    Route,
    Routes,
} from 'react-router-dom';

import LoginPage from './pages/LoginPage';
import HomePage from './pages/HomePage';
import RegisterPage from './pages/RegisterPage';

const AppRoutes = ({ location }) => {
    return (
        <Router>
            <Routes>
                <Route location={location} exact path="/login" element={ <LoginPage/> } />
                <Route location={location} path="/search/:keyword" component={ HomePage } exact />
                <Route location={location} exact path="/" element={ <HomePage/>} />
                <Route location={location} exact path="/register" element={ <RegisterPage /> } />
            </Routes>
        </Router>
    );
}

export default AppRoutes;
